using SeedValidation;

var client = new SeedValidationClient();
await client.CreateAsync(
    new CreateRequest
    {
        Decimal = 1.1,
        Even = 1,
        Name = "name",
        Shape = Shape.Square,
    }
);

using SeedValidation;

var client = new SeedValidationClient();
await client.GetAsync(
    new GetRequest
    {
        Decimal = 1.1,
        Even = 1,
        Name = "name",
    }
);
